import React from 'react';
import './App.css';
import Navbar from './Navbar';
import Footer from './Footer';

function App() {
  return (
    <div className="App">
      <Navbar />
      <main className="content">
        <h1>Welcome to My Website</h1>
        <p>This is a sample website with a navbar.</p>
        </main>
      <Footer />
    </div>
  );
}

export default App;
